// Simulator instruction cache.

struct ubicom32_scache {
  // executor
  union {
    cgoto_label cgoto;
    ubicom32_sem_fn* fn;
  } execute;

  // PC of this instruction.
  PCADDR addr;

  // instruction class
  ubicom32_idesc* idesc;

  // argument buffer
  ubicom32_sem_fields fields;



  // decode given instruction
  void decode (ubicom32bf_cpu* current_cpu, PCADDR pc, ubicom32_insn_word base_insn, ubicom32_insn_word entire_insn);
};

